import styled from "styled-components";

export const Header = styled.h1`
  text-align: center;
  color: rgb(41, 37, 37);
`;

export const CreateAccountLabelForInput = styled.label`
  display: inline-block;
  width: 100px;
  text-align: right;
`;

export const ErrorText = styled.p`
  font-size: 10px;
  color: red;
`;

